import React, { Component } from 'react';

class Text extends Component {
    constructor(props) {
        super(props);
        this.state = {
            name: props.name,
            job: props.job
        };
    }

    render() {
        return (
            <div>
                <p>{`مرحباً يا ${this.state.name} وظيفتك هي ${this.state.job}`}</p>
            </div>
        );
    }
}

export default Text;
